interface ISelfAdminnable {
    event SetRank(
        address indexed adminned,
        address indexed callerAdmin,
        address indexed targetAdmin,
        uint256 newRank
    );

    event DecreasedSelfRank(
        address indexed adminned,
        address indexed admin,
        uint256 newRank
