    function setRank(
        address adminned,
        address targetAdmin,
        uint256 newRank
    ) external;

    function decreaseSelfRank(address adminned, uint256 newRank) external;

    function adminnedToAdminToRank(address adminned, address admin)
        external
        view
        returns (uint256);
}
